function tocjfx(s)
{
    if (s.length>2){
        try{
            var str=fxpy[s.charCodeAt(0)][s.charCodeAt(1)];
            if (str!="undefined"){
                return str.toUpperCase();
            }
        }catch(e){
            return "";
        }
    }
    return "";
}

function getEnName(s)
{
    var p=s_getpy(s);
    var arp=p.split(" ");
    var cjfx=tocjfx(s);
    var s="",str="";
    if (cjfx!=""){ //有2字复姓
        str=cjfx;
        if (arp.length>=3){
            str+="-"
            for(i=2;i<arp.length;i++){
                str=str+arp[i];
            }
        }
    }else{

        for (i=0;i<arp.length;i++){
            if (i==1){ str+=" ";}
            else if (i==2) { str+="-";}
            if (i<2){
                str+=arp[i].substring(0,1).toUpperCase()+arp[i].substring(1,arp[i].length);
            }else {
                str+=arp[i];
            }

        }
    }
    return str;
}